// Screen.js
import React from 'react';
import { Container, Grid, AppBar, Toolbar, Button, Divider } from '@mui/material';
import MaterialTheme from '../styles/theme';
import NavigationBar from '../components/navBar';
import BlogBox from './blog';
import '../styles/Styles.css';

const CustomAppBar = () => {
  const themeColor = 'your_theme_color_here'; // Replace with your actual theme color
  const darkerColor = darkenColor(themeColor, 0.1); // Adjust the darkness level as needed

  return (
    <AppBar position="static" style={{ width: '100%', backgroundColor: darkerColor }}>
      <Toolbar>
        <Button color="inherit" style={{ textDecoration: 'underline' }}>
          Log-in / Registrarse
        </Button>
        <Divider orientation="vertical" flexItem />
        {/* Add more buttons or components as needed */}
      </Toolbar>
    </AppBar>
  );
};

// Function to darken a color
const darkenColor = (color, factor) => {
  const hex = color.replace(/^#/, '');
  const num = parseInt(hex, 16);
  const r = (num >> 16) * factor;
  const g = ((num >> 8) & 0x00ff) * factor;
  const b = (num & 0x0000ff) * factor;

  return `#${(1 << 24 | r << 16 | g << 8 | b).toString(16).slice(1)}`;
};

const Screen = () => {
  return (
    <MaterialTheme>
      <Container>
        <CustomAppBar />
        <Grid container justifyContent="flex-end" alignItems="flex-start" spacing={2}>
          <Grid item xs={12} className='backgroundContainer'>
            <NavigationBar />
            <BlogBox title="Example Title" likes={10} userLink="example.com" username="example_user" />
            {/* Add more BlogBox components as needed */}
          </Grid>
        </Grid>
      </Container>
    </MaterialTheme>
  );
};

export default Screen;
